var HTMLOption='<option value="%value%">%text%</option>\n';var HTMLAnuncio='<div class="col-md-6">\n<div class="thumbnail anuncio">\n<img class="img-responsive" src="images/%foto%-sm.jpg" alt="%titulo%">\n<div class="tipo-precio">\n<div class="tipo-precio-inner">\n<span>%precio%</span>\n</div>\n</div>\n<ol class="breadcrumb">\n<li>%tipoTrans%</li>\n<li>%tipoProp%</li>\n<li class="active">%ciudad%</li>\n</ol>\n<div class="caption anuncio-detalles">\n<h3 class="anuncio-titulo">%titulo%</h3>\n<a href="#" class="btn btn-primary" role="button">Más detalles</a>\n</div>\n</div>\n</div>\n';var HTMLgalleryClearfix='<div class="clearfix visible-md visible-lg"></div>\n';var options={search:{cities:[{value:"todas",text:"Todas",km:false},{value:"santa fe",text:"Santa Fe",km:false},{value:"santo tome",text:"Santo Tomé",km:false},{value:"la guardia",text:"La Guardia",km:true},{value:"colastine",text:"Colastiné",km:true},{value:"rincon",text:"Rincón",km:true},{value:"arroyo leyes",text:"Arroyo Leyes",km:true},],tipoProp:[{value:"todas",text:"Todas",},{value:"casa",text:"Casa"},{value:"departamento",text:"Departamento"},{value:"terreno",text:"Terreno"},{value:"cochera",text:"Cochera"},{value:"galpon",text:"Galpón"},{value:"local",text:"Local"},{value:"oficina",text:"Oficina"},{value:"quinta",text:"Quinta"},],},};var anuncios=[{foto:"8067-01",precio:"$ 2.000.000",titulo:"Excepcional Casa en Villa California",tipoTrans:"Venta",tipoProp:"Casa",ciudad:"Rincón",},{foto:"8068-01",precio:"$ 6.000",titulo:"Casa en Buen Estado, Centro",tipoTrans:"Alquiler",tipoProp:"Casa",ciudad:"Santa Fe",},{foto:"8067-01",precio:"$ 2.000.000",titulo:"Excepcional Casa en Villa California",tipoTrans:"Venta",tipoProp:"Casa",ciudad:"Rincón",},{foto:"8068-01",precio:"$ 6.000",titulo:"Casa en Buen Estado, Centro",tipoTrans:"Alquiler",tipoProp:"Casa",ciudad:"Santa Fe",},];options.search.appendCities=function(){var a=$("#ciudad");this.cities.forEach(function(c){var b=HTMLOption.replace("%value%",c.value).replace("%text%",c.text);a.append(b)})};options.search.appendTipoProp=function(){var a=$("#tipoProp");this.tipoProp.forEach(function(c){var b=HTMLOption.replace("%value%",c.value).replace("%text%",c.text);a.append(b)})};anuncios.append=function(){var b=$("#resultados > .row");var a=1;this.forEach(function(d){var c=HTMLAnuncio.replace(/%foto%/g,d.foto).replace("%precio%",d.precio).replace(/%titulo%/g,d.titulo).replace("%tipoTrans%",d.tipoTrans).replace("%tipoProp%",d.tipoProp).replace("%ciudad%",d.ciudad);b.append(c);if(a%2===0){b.append(HTMLgalleryClearfix)}a++})};